import React from 'react';
import Header from './components/Header/Header';

import TaskList from './components/Tasks/TaskList';
import { Route, Switch } from 'react-router-dom';
function App() {
  return (
    <React.Fragment>
      <Header/>
        <div>
          <Switch>
            <Route path="/" />
            <Route path="/tasks" element={ <TaskList/> } />
          </Switch>
        </div>
    </React.Fragment>
  );
}

export default App;
